                namaProduk: details.namaProduk,
                nieNumber: nieNumber,
                nieStatus: nieStatus,
                factoryInstance: details.factoryInstance,
                timestampExpired: timestampNieExpired
            });

            index++;
        }
    }

    return obatList;
